//# Laniatus Games Studio Inc. | TODO TASK: Multiple inheritance is not available in C#:
public class CGuildMarkUploader : CNetworkStream, CSingleton<CGuildMarkUploader>
{
		public const int ERROR_NONE = 0;
		public const int ERROR_CONNECT = 1;
		public const int ERROR_LOAD = 2;
		public const int ERROR_WIDTH = 3;
		public const int ERROR_HEIGHT = 4;

		public const int SEND_TYPE_MARK = 0;
		public const int SEND_TYPE_SYMBOL = 1;

		public CGuildMarkUploader()
		{
			this.m_pbySymbolBuf = null;
			SetRecvBufferSize(1024);
			SetSendBufferSize(1024);
			__Inialize();
		}

		public virtual void Dispose()
		{
			__OfflineState_Set();
		}

		public void Disconnect()
		{
			__OfflineState_Set();
		}

		public bool Connect(in CNetworkAddress c_rkNetAddr, uint dwHandle, uint dwRandomKey, uint dwGuildID, string c_szFileName, ref uint peError)
		{
			__OfflineState_Set();
			SetRecvBufferSize(1024);
			SetSendBufferSize(1024);

			if (!CNetworkStream.Connect(c_rkNetAddr))
			{
				peError = ERROR_CONNECT;
				return false;
			}

			m_dwSendType = SEND_TYPE_MARK;
			m_dwHandle = dwHandle;
			m_dwRandomKey = dwRandomKey;
			m_dwGuildID = dwGuildID;

			if (!__Load(c_szFileName, peError))
			{
				return false;
			}

			return true;
		}

		public bool ConnectToSendSymbol(in CNetworkAddress c_rkNetAddr, uint dwHandle, uint dwRandomKey, uint dwGuildID, string c_szFileName, ref uint peError)
		{
			__OfflineState_Set();
			SetRecvBufferSize(1024);
			SetSendBufferSize(64 * 1024);

			if (!CNetworkStream.Connect(c_rkNetAddr))
			{
				peError = ERROR_CONNECT;
				return false;
			}

			m_dwSendType = SEND_TYPE_SYMBOL;
			m_dwHandle = dwHandle;
			m_dwRandomKey = dwRandomKey;
			m_dwGuildID = dwGuildID;

			if (!__LoadSymbol(c_szFileName, peError))
			{
				return false;
			}

			return true;
		}

		public bool IsCompleteUploading()
		{
			return STATE_OFFLINE == m_eState;
		}

		public void Process()
		{
			CNetworkStream.Process();

			if (!__StateProcess())
			{
				__OfflineState_Set();
				Disconnect();
			}
		}

		private const int STATE_OFFLINE = 0;
		private const int STATE_LOGIN = 1;
		private const int STATE_COMPLETE = 2;

		private void OnConnectFailure()
		{
			__OfflineState_Set();
		}

		private void OnConnectSuccess()
		{
			__LoginState_Set();
		}

		private void OnRemoteDisconnect()
		{
			__OfflineState_Set();
		}

		private void OnDisconnect()
		{
			__OfflineState_Set();
		}

		private bool __Load(string c_szFileName, ref uint peError)
		{
			ILuint uImg = new ILuint();
			ilGenImages(1, uImg);
			ilBindImage(uImg);
			ilEnable(DefineConstants.IL_ORIGIN_SET);
			ilOriginFunc(DefineConstants.IL_ORIGIN_UPPER_LEFT);

			if (!ilLoad(DefineConstants.IL_TYPE_UNKNOWN, (ILstring)c_szFileName))
			{
				peError = ERROR_LOAD;
				return false;
			}

			if (ilGetInteger(DefineConstants.IL_IMAGE_WIDTH) != SGuildMark.WIDTH)
			{
				peError = ERROR_WIDTH;
				return false;
			}

			if (ilGetInteger(DefineConstants.IL_IMAGE_HEIGHT) != SGuildMark.HEIGHT)
			{
				peError = ERROR_HEIGHT;
				return false;
			}

			ilConvertImage(DefineConstants.IL_BGRA, DefineConstants.IL_BYTE);

			ilCopyPixels(0, 0, 0, SGuildMark.WIDTH, SGuildMark.HEIGHT, 1, DefineConstants.IL_BGRA, DefineConstants.IL_BYTE, (ILvoid)m_kMark.m_apxBuf);

			ilDeleteImages(1, uImg);
			return true;
		}

		private bool __LoadSymbol(string c_szFileName, ref uint peError)
		{
			ILuint uImg = new ILuint();
			ilGenImages(1, uImg);
			ilBindImage(uImg);
			ilEnable(DefineConstants.IL_ORIGIN_SET);
			ilOriginFunc(DefineConstants.IL_ORIGIN_UPPER_LEFT);
			if (!ilLoad(DefineConstants.IL_TYPE_UNKNOWN, (ILstring)c_szFileName))
			{
				peError = ERROR_LOAD;
				return false;
			}
			if (ilGetInteger(DefineConstants.IL_IMAGE_WIDTH) != 64)
			{
				peError = ERROR_WIDTH;
				return false;
			}
			if (ilGetInteger(DefineConstants.IL_IMAGE_HEIGHT) != 128)
			{
				peError = ERROR_HEIGHT;
				return false;
			}
			ilDeleteImages(1, uImg);
			ilShutDown();

			FILE file = fopen(c_szFileName, "rb");
			if (file == null)
			{
				peError = ERROR_LOAD;
			}

			fseek(file, 0, SEEK_END);
			m_dwSymbolBufSize = ftell(file);
			fseek(file, 0, SEEK_SET);

			m_pbySymbolBuf = new byte [m_dwSymbolBufSize];
			fread(m_pbySymbolBuf, m_dwSymbolBufSize, 1, file);

			fclose(file);

			m_dwSymbolCRC32 = GetFileCRC32(c_szFileName);
			return true;
		}

		private bool __Save(string c_szFileName)
		{
			return true;
		}

		private void __Inialize()
		{
			m_eState = STATE_OFFLINE;

			m_dwGuildID = 0;
			m_dwHandle = 0;
			m_dwRandomKey = 0;

			if (m_pbySymbolBuf)
			{
				m_pbySymbolBuf = null;
			}

			m_dwSymbolBufSize = 0;
			m_pbySymbolBuf = null;
		}

		private bool __StateProcess()
		{
			switch (m_eState)
			{
				case STATE_LOGIN:
					return __LoginState_Process();
					break;
			}

			return true;
		}

		private void __OfflineState_Set()
		{
			__Inialize();
		}

		private void __CompleteState_Set()
		{
			m_eState = STATE_COMPLETE;

			__OfflineState_Set();
		}

		private void __LoginState_Set()
		{
			m_eState = STATE_LOGIN;
		}

		private bool __LoginState_Process()
		{
			if (!__AnalyzePacket(LG_HEADER_GC_PHASE, sizeof(packet_phase), CGuildMarkUploader.__LoginState_RecvPhase))
			{
				return false;
			}

			if (!__AnalyzePacket(LG_HEADER_GC_HANDSHAKE, sizeof(packet_LG_HEADER_handshake), CGuildMarkUploader.__LoginState_RecvHandshake))
			{
				return false;
			}

			if (!__AnalyzePacket(LG_HEADER_GC_PING, sizeof(packet_ping), CGuildMarkUploader.__LoginState_RecvPing))
			{
				return false;
			}

#if _IMPROVED_PACKET_ENCRYPTION_
			if (!__AnalyzePacket(LG_HEADER_GC_KEY_AGREEMENT, sizeof(TPacketKeyAgreement), CGuildMarkUploader.__LoginState_RecvKeyAgreement))
			{
				return false;
			}

			if (!__AnalyzePacket(LG_HEADER_GC_KEY_AGREEMENT_COMPLETED, sizeof(TPacketKeyAgreementCompleted), CGuildMarkUploader.__LoginState_RecvKeyAgreementCompleted))
			{
				return false;
			}
#endif

			return true;
		}

		private bool __LoginState_RecvPhase()
		{
			packet_phase kPacketPhase = new packet_phase();
			if (!Recv(sizeof(packet_phase), kPacketPhase))
			{
				return false;
			}

			if (kPacketPhase.phase == PHASE_LOGIN)
			{
#if ! _IMPROVED_PACKET_ENCRYPTION_
				string key = DefineConstants.LSS_SECURITY_KEY;
				SetSecurityMode(true, key);
#endif

				if (SEND_TYPE_MARK == m_dwSendType)
				{
					if (!__SendMarkPacket())
					{
						return false;
					}
				}
				else if (SEND_TYPE_SYMBOL == m_dwSendType)
				{
					if (!__SendSymbolPacket())
					{
						return false;
					}
				}
			}

			return true;
		}

		private bool __LoginState_RecvHandshake()
		{
			packet_LG_HEADER_handshake kPacketHandshake = new packet_LG_HEADER_handshake();
			if (!Recv(sizeof(packet_LG_HEADER_handshake), kPacketHandshake))
			{
				return false;
			}

			{
				command_mark_login kPacketMarkLogin = new command_mark_login();
				kPacketMarkLogin.header = LG_HEADER_CG_MARK_LOGIN;
				kPacketMarkLogin.handle = m_dwHandle;
				kPacketMarkLogin.random_key = m_dwRandomKey;
				if (!Send(sizeof(command_mark_login), kPacketMarkLogin))
				{
					return false;
				}
			}

			return true;
		}

		private bool __LoginState_RecvPing()
		{
			packet_ping kPacketPing = new packet_ping();
			if (!Recv(sizeof(packet_ping), kPacketPing))
			{
				return false;
			}

			packet_pong kPacketPong = new packet_pong();
			kPacketPong.bHeader = LG_HEADER_CG_PONG;

			if (!Send(sizeof(packet_pong), kPacketPong))
			{
				return false;
			}

			if (IsSecurityMode())
			{
				return SendSequence();
			}
			else
			{
				return true;
			}
		}

#if _IMPROVED_PACKET_ENCRYPTION_
#if _IMPROVED_PACKET_ENCRYPTION_
		private bool __LoginState_RecvKeyAgreement()
		{
			TPacketKeyAgreement packet = new TPacketKeyAgreement();
			if (!Recv(sizeof(TPacketKeyAgreement), packet))
			{
				return false;
			}

			Tracenf("KEY_AGREEMENT RECV %u", packet.wDataLength);

			TPacketKeyAgreement packetToSend = new TPacketKeyAgreement();
			size_t dataLength = TPacketKeyAgreement.MAX_DATA_LEN;
			size_t agreedLength = Prepare(packetToSend.data, dataLength);
			if (agreedLength == 0)
			{
				Disconnect();
				return false;
			}
			Debug.Assert(dataLength <= TPacketKeyAgreement.MAX_DATA_LEN);

			if (Activate(packet.wAgreedLength, packet.data, packet.wDataLength))
			{
				packetToSend.bHeader = LG_HEADER_CG_KEY_AGREEMENT;
				packetToSend.wAgreedLength = (ushort)agreedLength;
				packetToSend.wDataLength = (ushort)dataLength;

				if (!Send(sizeof(TPacketKeyAgreement), packetToSend))
				{
					Tracen(" CAccountConnector::__AuthState_RecvKeyAgreement - SendKeyAgreement Error");
					return false;
				}
				Tracenf("KEY_AGREEMENT SEND %u", packetToSend.wDataLength);
			}
			else
			{
				Disconnect();
				return false;
			}
			return true;
		}

		private bool __LoginState_RecvKeyAgreementCompleted()
		{
			TPacketKeyAgreementCompleted packet = new TPacketKeyAgreementCompleted();
			if (!Recv(sizeof(TPacketKeyAgreementCompleted), packet))
			{
				return false;
			}
			Tracenf("KEY_AGREEMENT_COMPLETED RECV");
			ActivateCipher();

			return true;
		}

#endif

		private delegate bool pfnDispatchPacketDelegate();

		private bool __AnalyzePacket(uint uHeader, uint uPacketSize, pfnDispatchPacketDelegate pfnDispatchPacket)
		{
			byte bHeader;
			if (!Peek(sizeof(byte), bHeader))
			{
				return true;
			}

			if (bHeader != uHeader)
			{
				return true;
			}

			if (!Peek(uPacketSize))
			{
				return true;
			}

			return pfnDispatchPacket();
		}

		private bool __SendMarkPacket()
		{
			command_mark_upload kPacketMarkUpload = new command_mark_upload();
			kPacketMarkUpload.header = LG_HEADER_CG_MARK_UPLOAD;
			kPacketMarkUpload.gid = m_dwGuildID;

			Debug.Assert(sizeof(kPacketMarkUpload.image) == sizeof(m_kMark.m_apxBuf));
//# Laniatus Games Studio Inc. | TODO TASK: The memory management function 'memcpy' has no equivalent in C#:
			memcpy(kPacketMarkUpload.image, m_kMark.m_apxBuf, sizeof(kPacketMarkUpload.image));

			if (!Send(sizeof(command_mark_upload), kPacketMarkUpload))
			{
				return false;
			}

			return true;
		}

		private bool __SendSymbolPacket()
		{
			if (!m_pbySymbolBuf)
			{
				return false;
			}

			command_symbol_upload kPacketSymbolUpload = new command_symbol_upload();
			kPacketSymbolUpload.header = LG_HEADER_CG_GUILD_SYMBOL_UPLOAD;
			kPacketSymbolUpload.handle = m_dwGuildID;
